const Certificates = () => {
  return (
    <div style={{ minHeight: '80vh', backgroundColor: '#111', color: '#fff', padding: '2rem' }}>
      <h1 style={{ color: '#ff6600', fontSize: '2.5rem', marginBottom: '1rem' }}>Certificates</h1>
      <ul style={{ color: '#ccc', fontSize: '1.2rem', lineHeight: '1.8' }}>
        <li>The iScale: Full Stack Data Science with Generative AI Program | <a href="#" style={{ color: '#ff6600' }}>Link</a></li>
        <li>CSRBox collaborated with IBM SkillsBuild: Artificial Intelligence | <a href="#" style={{ color: '#ff6600' }}>Link</a></li>
        <li>IBM SkillBuild Data Analytics with CSRBox</li>
        <li>CSRBox collaborated with IBM SkillsBuild: Data Analytics | <a href="#" style={{ color: '#ff6600' }}>Link</a></li>
      </ul>
    </div>
  );
};

export default Certificates;
